import React from 'react'

function Header({setisAdding}) {
  return (
    <header>
        <h1>Users Dashboard</h1>
        <div>
            <button onClick={() => setisAdding(true)} className="round-button"></button>
        </div>
    </header>
  )
}

export default Header
